import React from "react";

const AdminDashboard = () => {
  return (
    <div>
      <h1>Admin Dashboard</h1>
      <nav>
        <ul>
          <li><a href="/manage-trains">Manage Trains</a></li>
          <li><a href="/manage-employees">Manage Employees</a></li>
          <li><a href="/view-reservations">View Reservations</a></li>
          <li><a href="/manage-faqs">Manage FAQs</a></li>
        </ul>
      </nav>
    </div>
  );
};

export default AdminDashboard;
